    import './Car.css';

    function Car() {

      const WEIGHT_MAX = 2500;
      const POWER_MAX = 1000;
      const RATIO_MAX = 10;

      const calcul = {
        calcpercent : (val, val_max) => {
          return (100*val/val_max);
        }
      }

      const weight = 1789;
      const power = 547;
      const ratio = weight/power;

        return (
            <section className="car-content">
                  <details className="car-details">
                    <summary className="car-summary">
                      <span className="car">SHELBY GT500</span>&nbsp;-&nbsp;<span className="year">2011</span>
                    </summary>
                    <section className="bars">
                      <div className="bar-title"><label>Weight</label><span><span className="weight">1789</span>kg</span></div>
                      <div className="bar bar-weight" style={{width: calcpercent(weight,WEIGHT_MAX)+'%'}}></div>
                      <div className="bar-title"><label>Power</label><span><span className="power">547</span>hp</span></div>
                      <div className="bar bar-power" style={{width: calcpercent(power,POWER_MAX)+'%'}}></div>
                      <div className="bar-title"><label>Ratio</label><span><span className="ratio">3.3</span>kg/hp</span></div>
                      <div className="bar bar-ratio" style={{width: calcpercent(ratio,RATIO_MAX)+'%'}}></div>
                    </section>
                  </details>
                </section>
        );
    }

    export default Car;
